Sonic\ Visualiser.app/Contents/PkgInfo: 
	@test -d Sonic\ Visualiser.app/Contents || mkdir -p Sonic\ Visualiser.app/Contents
	@$(DEL_FILE) Sonic\ Visualiser.app/Contents/PkgInfo
	@echo "APPL????" > Sonic\ Visualiser.app/Contents/PkgInfo
Sonic\ Visualiser.app/Contents/Resources/empty.lproj: 
	@test -d Sonic\ Visualiser.app/Contents/Resources || mkdir -p Sonic\ Visualiser.app/Contents/Resources
	@touch Sonic\ Visualiser.app/Contents/Resources/empty.lproj
	
Sonic\ Visualiser.app/Contents/Info.plist: 
	@test -d Sonic\ Visualiser.app/Contents || mkdir -p Sonic\ Visualiser.app/Contents
	@$(DEL_FILE) Sonic\ Visualiser.app/Contents/Info.plist
	@sed -e "s,@SHORT_VERSION@,1.0,g" -e "s,@FULL_VERSION@,1.0.0,g" -e "s,@TYPEINFO@,????,g" -e "s,@BUNDLEIDENTIFIER@,com.yourcompany.Sonic Visualiser,g" -e "s,@ICON@,sv-macicon.icns,g" -e "s,@EXECUTABLE@,Sonic Visualiser,g" -e "s,@LIBRARY@,Sonic Visualiser,g" -e "s,@TYPEINFO@,????,g" deploy/osx/Info.plist >Sonic\ Visualiser.app/Contents/Info.plist
