	@test -d Sonic\ Visualiser.app/Contents/Resources/ || mkdir -p Sonic\ Visualiser.app/Contents/Resources/
	@$(DEL_FILE) Sonic\ Visualiser.app/Contents/Resources/sv-macicon.icns
	@$(COPY_FILE) icons/sv-macicon.icns Sonic\ Visualiser.app/Contents/Resources/sv-macicon.icns

